B.ahH=A.a(s(["Lietuvoje asbesto turin\u010di\u0173 gamini\u0173 prad\u0117ta atsisakyti nuo 2005 m., ta\u010diau seniau asbest\u0105 b\u016bdavo \u012fprasta naudoti \u0161iose med\u017eiagose ir gaminiuose:","\u2022 \u0161iferio lak\u0161tai stogams dengti;","\u2022 besl\u0117giai vamzd\u017eiai kanalizacijos kanalams \u012frengti;","\u2022 kaip termoizoliacin\u0117s med\u017eiagos katilin\u0117se, \u0161ilumin\u0117se trasose;","\u2022 naudojamos asbestinio audinio, nedegios aprangos ir \u012fvairi\u0173 ekran\u0173 gamyboje;","\u2022 naudojamos elektrini\u0173 laid\u0173 izoliacijai;","\u2022 naudojamos automobili\u0173 stabd\u017ei\u0173 kalad\u0117li\u0173 \u012fd\u0117kl\u0173 gamybai.","\u2022 vamzd\u017ei\u0173 ir boileri\u0173 izoliacin\u0117s med\u017eiagos, \u012fskaitant pur\u0161kiamas;","\u2022 izoliacin\u0117s lentos, atsparios ugniai, naudojamos dur\u0173 panel\u0117se, pertvarose, lub\u0173 panel\u0117se, taip pat kaitlen\u010di\u0173, orkai\u010di\u0173 ir \u0161ildytuv\u0173 izoliacijai;","\u2022 lyn\u0173 izoliacija arba suspaustos tarpin\u0117s vamzdynams;","\u2022 profiliuotos cementin\u0117s stogo dangos lak\u0161tai ir \u010derp\u0117s;","\u2022 cementiniai vamzd\u017eiai, d\u016bmtakiai, latakai ir vandens rezervuarai;","\u2022 vinilin\u0117s grind\u0173 plytel\u0117s ir bituminiai klijai;","\u2022 tekst\u016bruotos dangos ir da\u017eai, kuriuose yra asbesto;","\u2022 linoleumas, kuriame yra asbesto;","\u2022 i\u0161lieti gaminiai, tokie kaip cisternos ir rezervuarai;","\u2022 bitumin\u0117 danga ir dr\u0117gmei atspar\u016bs sluoksniai.",u.A,"16 01 11* \u2013 stabd\u017ei\u0173 trinkel\u0117s, kuriose yra asbesto;","16 02 12* \u2013 nebenaudojama \u012franga, kurioje yra grynojo asbesto;","17 06 01* \u2013 izoliacin\u0117s med\u017eiagos, kuriose yra asbesto;","17 06 05* \u2013 statybin\u0117s med\u017eiagos, kuriose yra asbesto (\u0161iferis)."]),t.s)
