B.Gl=A.a(s(["VISADA pavojingosios pakuot\u0117s:","- pakuot\u0117s nuo alyvos bei da\u017e\u0173, lak\u0173, klij\u0173, tirpikli\u0173, ra\u0161alo ir pan. med\u017eiag\u0173, naudojam\u0173 statybos ir remonto darbams;","- metalin\u0117s pakuot\u0117s, kuriose esama pavojing\u0173j\u0173 kiet\u0173 poring\u0173 ri\u0161am\u0173j\u0173 med\u017eiag\u0173 (pvz., asbesto senoje ugniai atsparioje pakuot\u0117s med\u017eiagoje), \u012fskaitant tu\u0161\u010dias susl\u0117gto oro talpyklas;","- visais atvejais prakti\u0161kai tu\u0161\u010dios pakuot\u0117s yra laikomos pavojingosiomis atliekomis, jeigu jose buvo supakuotos sprogiosios, pavojingos sveikatai ar \u016bmaus toksi\u0161kumo med\u017eiagos, ir pa\u017eym\u0117tos atitinkamomis pavojaus piktogramomis.","Kai pakuot\u0117je esama liku\u010di\u0173, kuri\u0173 \u012fprastais b\u016bdais pa\u0161alinti ne\u012fmanoma (pvz., d\u0117l angos dyd\u017eio arba med\u017eiagos pob\u016bd\u017eio), atliekas reik\u0117t\u0173 r\u016b\u0161iuoti ir tvarkyti ne kaip pakuo\u010di\u0173 atliekas, o kaip med\u017eiagos liku\u010di\u0173 atliekas."]),t.s)
